import React from 'react';

function Welcome(props){

    return(
        <div className="container">
            <div className="Fitness-User-Info">
                <h1>Hello {props.username}!</h1>
                <p>Lets Work!</p>
            </div>
        </div>
    )

}

export default Welcome
